    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE ( NOT - col0 * + ( col2 ) + col0 / + 65 IN ( 30 + - col0 + - + 53, - col2, + col2 + ( - + 82 ) ) );
  - name: tab1

outputs:
  - name: q954.out
    data: |
      51	14	96
      85	5	59
      91	47	68
